column771:
09/Oct/25 6:30 AM;712020:e8d4fbf0-81f5-4cf9-831b-b77251685cc5;Prod.products is synthesised based on staging.mysql_payments_product and which is again on top of eds_ext.l1_l2_stg_payments_ownable_products which is spectrum table build on top of prod.general.*stg_payments_ownable_products* .

So complete flow 

{{prod.general.stg_payments_ownable_products}} → {{eds_ext.l1_l2_stg_payments_ownable_products}} → {{staging.mysql_payments_product}}  → {{prod.products}}

We can say {{prod.products}} can be derived from EDS counter part {{prod.general.stg_payments_ownable_products}}
